import './header.css';

export default function Header() {
  return (
    <div className="header">
      <div className="headerTitles">
        <span className="headerTitleSm">Douglas Mogoba</span>
        <span className="headerTitleLg">My Blogs</span>
      </div>
      <img
        className="headerImg"
        src="https://scontent.fnbo8-1.fna.fbcdn.net/v/t39.30808-6/236058395_1057410914796677_4432392837850619659_n.jpg?_nc_cat=110&ccb=1-5&_nc_sid=09cbfe&_nc_eui2=AeHxdvLOiU_5PvTQypqkmZKueXUppnsRBRF5dSmmexEFEW_8WuHOLBSFzr827iFYm7EOzJiB9mXIUBkSre7l56Fh&_nc_ohc=aJqjSIj9EHEAX8-ZPLa&_nc_ht=scontent.fnbo8-1.fna&oh=1b5fbed62aa9f7c9e0d2de9c7c116d52&oe=6153F5DF"
        alt=""
      />
    </div>
  );
}
